from collections import defaultdict

class Solution:
    def minWindow(self, s: str, t: str) -> str:
        t_freq = self.charFreq(t)
        freq = defaultdict(int)
        b = 0
        e = 0
        substring = ''
        while b < len(s):
            # as long as the frequencies are the same then keep reducing the beginning side
            if self.containsAllKeys(freq, t_freq):
                # determine if we can capture the substring or replace it
                if substring is '':
                    substring = s[b:e]
                elif len(s[b:e]) < len(substring):
                    substring = s[b:e]

                # move b forward
                freq[s[b]] -= 1
                if freq[s[b]] == 0:
                    del freq[s[b]]
                b += 1
                freq[b] += 1
            else:
                # if there is no longer a match move the right forward
                # move e forward, but only if it's possible otherwise, default to moving b
                if e < len(s):
                    freq[s[e]] += 1
                    e += 1
                else:
                    freq[s[b]] -= 1
                    if freq[s[b]] == 0:
                        del freq[s[b]]
                    b += 1
                    freq[b] += 1

        return substring

    def containsAllKeys(self, freq, t_freq):
        contains_all_keys = True
        for key in t_freq.keys():
            if key not in freq:
                contains_all_keys = False
            elif key in freq and freq[key] < t_freq[key]:
                contains_all_keys = False
        return contains_all_keys

    def charFreq(self, string):
        freq = defaultdict(int)
        for s in string:
            freq[s] += 1
        return freq



if __name__ == "__main__":
    sol = Solution()

    output = sol.minWindow('ADOBECODEBANC', 'ABC')
    assert output == 'BANC'

    output = sol.minWindow('A', 'ABC')
    assert output == ''

    output = sol.minWindow('A', 'A')
    assert output == 'A'

    output = sol.minWindow('ADOBECODEBANC', 'ABE')
    assert output == 'EBA'

    output = sol.minWindow('AA', 'AA')
    assert output == 'AA'

    output = sol.minWindow('ABABCCA', 'ABCC')
    assert output == 'ABCC'

    s = ""
    t = ""
    output = sol.minWindow(s, t)
    assert output == ""
